shaders.vertex:
attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = aVertex;
}

shaders.fragment:
varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;

uniform int blur; // 1, 8, 3
uniform float threshold; // 0.0, 1.0, 0.5

vec4 hblur() {
  const float sigma = 2.0;
  float c = 1.0 / ( sqrt(2.0 * 3.1415926535 ) * sigma );
  vec2 d = vec2(1.0, 1.0) / uResolution;
  float ec = 2.0 * sigma * sigma;
  float weight0 = exp( -( 0.0 * 0.0 ) / ec ) * c;
  float weight1 = exp( -( 1.0 * 1.0 ) / ec ) * c;
  float weight2 = exp( -( 2.0 * 2.0 ) / ec ) * c;
  float weight3 = exp( -( 3.0 * 3.0 ) / ec ) * c;
  float weight4 = exp( -( 4.0 * 4.0 ) / ec ) * c;
  float weight5 = exp( -( 5.0 * 5.0 ) / ec ) * c;
  float weight6 = exp( -( 5.0 * 5.0 ) / ec ) * c;
  float weight7 = exp( -( 5.0 * 5.0 ) / ec ) * c;
  float weight8 = exp( -( 5.0 * 5.0 ) / ec ) * c;
  vec4 acc = vec4(0.0);

  acc += texture2D( uTexture, vTexCoord ) * weight0;
  acc += texture2D( uTexture, vTexCoord + d * vec2( 1.0, 0.0 ) ) * weight1;
  acc += texture2D( uTexture, vTexCoord + d * vec2( -1.0, 0.0 ) ) * weight1;
  if (blur > 1) {
      acc += texture2D( uTexture, vTexCoord + d * vec2( 2.0, 0.0 ) ) * weight2;
      acc += texture2D( uTexture, vTexCoord + d * vec2( -2.0, 0.0 ) ) * weight2;
  }
  if (blur > 2) {
      acc += texture2D( uTexture, vTexCoord + d * vec2( 3.0, 0.0 ) ) * weight3;
      acc += texture2D( uTexture, vTexCoord + d * vec2( -3.0, 0.0 ) ) * weight3;
  }
  if (blur > 3) {
      acc += texture2D( uTexture, vTexCoord + d * vec2( 4.0, 0.0 ) ) * weight4;
      acc += texture2D( uTexture, vTexCoord + d * vec2( -4.0, 0.0 ) ) * weight4;
  }
  if (blur > 4) {
      acc += texture2D( uTexture, vTexCoord + d * vec2( 5.0, 0.0 ) ) * weight5;
      acc += texture2D( uTexture, vTexCoord + d * vec2( -5.0, 0.0 ) ) * weight5;
  }
  if (blur > 5) {
      acc += texture2D( uTexture, vTexCoord + d * vec2( 6.0, 0.0 ) ) * weight6;
      acc += texture2D( uTexture, vTexCoord + d * vec2( -6.0, 0.0 ) ) * weight6;
  }
  if (blur > 6) {
      acc += texture2D( uTexture, vTexCoord + d * vec2( 7.0, 0.0 ) ) * weight7;
      acc += texture2D( uTexture, vTexCoord + d * vec2( -7.0, 0.0 ) ) * weight7;
  }
  if (blur > 7) {
      acc += texture2D( uTexture, vTexCoord + d * vec2( 8.0, 0.0 ) ) * weight8;
      acc += texture2D( uTexture, vTexCoord + d * vec2( -8.0, 0.0 ) ) * weight8;
  }
  return acc;
}


void main() {
  vec4 acc = hblur();
  float brightness = dot(acc, vec4(0.299, 0.587, 0.114, 0.0));
  if (brightness > threshold)
     gl_FragColor = vec4(1.0);
  else
     gl_FragColor = vec4(0.0, 0.0, 0.0, 1.0);
}
